import React from "react";
import largeLogo from "../../ApartmintLogoSmall.png";
import "./styles.css";

function App() {
  return (
    <div className="Logo">
      <header className="App-header">
        <img src={largeLogo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
